import React from 'react';
import ReactDOM from 'react-dom/client';

import './header.css';

export function Logo()
:  JSX.Element
{
	return (
		<div id="logo">

			<div id="P">P</div>
			<div id="O">O</div>
			<div id="N">N</div>
			<div id="G">G</div>

		</div>
	);
}
